XtMg0qD9SBZEktYkEtGgEqtJS7vl9XRFPmvzo","https://lh5.googleusercontent.com/YRbdOradVCJK0d64cYCb5EphsOS0rP7QJCfY3FSvc5Bdmcc6vGPZzio4YB608UVOfGB973EzbrLCL2773EPhjc27R24TvZ4zek5YMvB7zNXo0ON9Va3iBtSqWyh3WE0EtjCd15EOXF0","https://lh3.googleusercontent.com/D9fXhsp4Kj-y-B5YHTZUnUQTOfYvVaVyHEg1_UJAEJp3wHW9JgVQhBrN9ELNowYbO-bsyTKzfb6zj6bcgjl_4ABw30n5KTXHNtnSJ8-Cl7_qpQ81eZpgPOI1T_BLqPn0yw2cjUQFVJA"],[],1],["g17b63cba64f7a1bf_193",20,"Powered by Open Source",[],[],[["https://www.google.com/url?q\u003dhttps://opensource.com/article/17/11/intro-tensorflow\u0026sa\u003dD\u0026ust\u003d1559559487205000\u0026usg\u003dAFQjCNHcU4ttl_wSMiDSMY8WsMCWtHHYjw","https://opensource.com/article/17/11/intro-tensorflow","https://opensource.com/article/17/11/intro-tensorflow"]],[],[[],0],[],"\u003cp style\u003d\"font-weight:400;font-style:normal;text-decoration:none;background-color:inherit;color:#000000;font-family:Arial;font-size:14.0pt;font-variant:normal;text-align:left;direction:ltr;\"\u003eAnd sitting underneath all this is an open source library called TensorFlow.\u003c/p\u003e\u003cp style\u003d\"font-weight:400;font-style:normal;text-decoration:none;background-color:inherit;color:#000000;font-family:Arial;font-size:14.0pt;font-variant:normal;text-align:left;direction:ltr;\"\u003e\u0026#8203;\u003c/p\u003e\u003cp style\u003d\"font-weight:400;font-style:normal;text-decoration:none;background-color:inherit;color:#000000;font-family:Arial;font-size:14.0pt;font-variant:normal;text-align:left;direction:ltr;\"\u003eTensorFlow as developed by the Google Brain team - the people behind the AlphaGo computer. But from the beginning we knew we wanted to let everyone in the industry benefit so we made TensorFlow an open source project on Github.\u003c/p\u003e\u003cp style\u003d\"font-weight:400;font-style:normal;text-decoration:none;background-color:inherit;color:#000000;font-family:Arial;font-size:14.0pt;font-variant:normal;text-align:left;direction:ltr;\"\u003e\u0026#8203;\u003c/p\u003e\u003cp style\u003d\"font-weight:400;font-style:normal;text-decoration:none;background-color:inherit;color:#000000;font-family:Arial;font-size:14.0pt;font-variant:normal;text-align:left;direction:ltr;\"\u003eThe uptake has been phenomenal. TF is the most popular ML project on Github, with contributions coming from many companies not just Google.\u003c/p\u003e\u003cp style\u003d\"font-weight:400;font-style:normal;text-decoration:none;background-color:inherit;color:#000000;font-family:Arial;font-size:14.0pt;font-variant:normal;text-align:left;direction:ltr;\"\u003e\u0026#8203;\u003c/p\u003e\u003cp style\u003d\"font-weight:400;font-style:normal;text-decoration:none;background-color:inherit;color:#000000;font-family:Arial;font-size:14.0pt;font-variant:normal;text-align:left;direction:ltr;\"\u003eIn addition to being a powerful framework, TF was designed to run anywhere. You can not only run TF models using our fully managed Cloud ML, but you can also run them on your own servers in your own datacenters, on VMs in other cloud providers, or even compile them down to ARM code and run them on mobile devices. \u003c/p\u003e",["https://lh6.googleusercontent.com/wf8RzJy7bnn2NMww_hIMKHi4fptPQXOR22WvvXSOCTQ7CSV7KAg6H0366q_rJhg2mAxJgAzR9n2H3c-Y0egwciz_h8STca5J59tvoCmnJT7qpKDaNlcSIwFADTyxVjzkuOFULRjuWXU","https://lh5.googleusercontent.com/fOy16dSxzJpOSFOliD_EMsapmGn4OvYYfLZ6PDq8L2jdDJKVxP2ff1wz7nxnZodJODsaJ64gbVduYAXUB99o3YoURngMOXw6y0h6QarcGgIvgHezGJj_QtC2gh8AbQVWL4TmI3eaVQ4"],[],1],["g17b63cba64f7a1bf_309",21,"",[],[],[],[],[[],0],[],"\u003cp style\u003d\"font-weight:300;font-style:normal;text-decoration:none;background-color:inherit;color:#545454;font-family:Roboto;font-size:18.0pt;font-variant:normal;text-align:left;direction:ltr;\"\u003eGoogle-designed custom ASIC built \u003cbr\u003eand optimized for TensorFlow\u003c/p\u003e\u003cp style\u003d\"font-weight:400;font-style:normal;text-decoration:none;background-color:inherit;color:#000000;font-family:Arial;font-size:14.0pt;font-variant:normal;text-align:left;direction:ltr;\"\u003eAnother key benefit: Tensor Processing Unit (TPU), custom ASIC built specifically for machine learning. Been running TPUs inside our data centers for more than a year, and have found they deliver order of magnitude better performance per watt for ML tasks.\u003c/p\u003e\u003cp style\u003d\"font-weight:400;font-style:normal;text-decoration:none;background-color:inherit;color:#000000;font-family:Arial;font-size:14.0pt;font-variant:normal;text-align:left;direction:ltr;\"\u003e\u0026#8203;\u003c/p\u003e\u003cp style\u003d\"font-weight:400;font-style:normal;text-decoration:none;background-color:inherit;color:#000000;font-family:Arial;font-size:11.0pt;font-variant:normal;text-align:left;direction:ltr;\"\u003eThe result is called a Tensor Processing Unit (TPU), a custom ASIC we built specifically for machine learning  and tailored for TensorFlow. Weve been running TPUs inside our data centers for more than a year, and have found them to deliver an order of magnitude better-optimized performance per watt for machine learning. This is roughly equivalent to fast-forwarding technology about seven years into the future (three generations of Moores Law).\u003c/p\u003e\u003cp style\u003d\"font-weight:400;font-style:normal;text-decoration:none;background-color:inherit;color:#000000;font-family:Arial;font-size:14.0pt;font-variant:normal;text-align:left;direction:ltr;\"\u003e\u0026#8203;\u003c/p\u003e\u003cp style\u003d\"font-weight:400;font-style:normal;text-decoration:none;background-color:inherit;color:#000000;font-family:Arial;font-size:14.0pt;font-variant:normal;text-align:left;direction:ltr;\"\u003e\u0026#8203;\u003c/p\u003e\u003cp style\u003d\"font-weight:400;font-style:normal;text-decoration:none;background-color:inherit;color:#000000;font-family:Arial;font-size:11.0pt;font-variant:normal;text-align:left;direction:ltr;\"\u003e\u0026#8203;\u003c/p\u003e\u003cp style\u003d\"font-weight:300;font-style:normal;text-decoration:none;backgro lrpLGYiFIYi5d_LaiEo66GA2A"],[],1],["g5604ea3304_1_0",28,"",[],[],[["https://www.google.com/url?q\u003dhttps://console.cloud.google.com/bigquery?project%3Dmcohen-io%26folder%26organizationId\u0026sa\u003dD\u0026ust\u003d1559559487223000\u0026usg\u003dAFQjCNH2bUu_-bKfgBw_qSqOgSVczOgezQ","Picture","https://console.cloud.google.com/bigquery?project\u003dmcohen-io\u0026folder\u0026organizationId"]],[],[[[[[[[0,0.0,1.0,0.0,1.0,0]],"g5604ea3304_1_2",1000,0,1,0,0]]]],0],[],"\u003cp style\u003d\"font-weight:400;font-style:normal;text-decoration:none;background-color:inherit;color:#000000;font-family:Arial;font-size:11.0pt;font-variant:normal;text-align:left;direction:ltr;\"\u003eHow long it would take to read 4 Terabytes from a hard drive at 100 MB/s? About 11 hours \u003c/p\u003e\u003cp style\u003d\"font-weight:400;font-style:normal;text-decoration:none;background-color:inherit;color:#000000;font-family:Arial;font-size:11.0pt;font-variant:normal;text-align:left;direction:ltr;\"\u003eAnd to filter 100 billion data points using a regular expression for each? About 27 hours \u003c/p\u003e\u003cp style\u003d\"font-weight:400;font-style:normal;text-decoration:none;background-color:inherit;color:#000000;font-family:Arial;font-size:11.0pt;font-variant:normal;text-align:left;direction:ltr;\"\u003eAnd moving 278 GB across a 1 Gbps network? About 40 minutes\u003c/p\u003e",["https://lh3.googleusercontent.com/z7bl_Hk5fLqvkAXhHr9G9MKzv1XpyQDSiW1yHrmB57ZV9-ZG2kns6-kbkSMqChu-pO8oOhWNkVLt1tQSiwr9haiDk-S644XNlSzCubqjxsEElmt5sgDghtI6ZMOX10onUk3kNWGRXqQ"],[],1],["g49bdf57b3d_0_723",29,"",[],[],[["https://www.google.com/url?q\u003dhttp://vision-explorer.reactive.ai/%23/galaxy?_k%3Dbw79mx\u0026sa\u003dD\u0026ust\u003d1559559487227000\u0026usg\u003dAFQjCNH13T9V47spJgjDu_J4N0iqv5mLUA","Picture","http://vision-explorer.reactive.ai/#/galaxy?_k\u003dbw79mx"],["https://www.google.com/url?q\u003dhttp://vision-explorer.reactive.ai/%23/galaxy?_k%3D9xzxu3\u0026sa\u003dD\u0026ust\u003d1559559487228000\u0026usg\u003dAFQjCNErcpVy2NrXX2smOPLybOp544nRrQ","Demo","http://vision-explorer.reactive.ai/#/galaxy?_k\u003d9xzxu3"]],[],[[],0],[],"",["https://lh4.googleusercontent.com/hfIXRQATgPCXkp2uYnS7ESuVeo4TKlIrxzr0aqZ_dgFKgPAWpMEZ0RrHHMIfrHu4OyH_sOck2NUpec5JqPP_44txlJZBMqOMvRScr21EhWFdXlopZpOF6WGvc7qsRNcwmHP1kMYy4mU"],[],1],["g4cf1f4d8bb_2_362",30,"",[],[],[["https://www.google.com/url?q\u003dhttps://cloud.google.com/ml-engine/\u0026sa\u003dD\u0026ust\u003d1559559487229000\u0026usg\u003dAFQjCNHwWwLVtha-vBm3QsWX_Gj6qnsplw","cloud.google.com/ml-engine","https://cloud.google.com/ml-engine/"]],[],[[],0],[],"\u003cp style\u003d\"font-weight:400;font-style:normal;text-decoration:none;background-color:inherit;color:#000000;font-family:Arial;font-size:14.0pt;font-variant:normal;text-align:left;direction:ltr;\"\u003eWith CMLE we make it super easy to train and serve your models in the cloud.\u003c/p\u003e\u003cp style\u003d\"font-weight:400;font-style:normal;text-decoration:none;background-color:inherit;color:#000000;font-family:Arial;font-size:14.0pt;font-variant:normal;text-align:left;direction:ltr;\"\u003eCloud ML gives you fully managed training and prediction service.\u003c/p\u003e\u003cp style\u003d\"font-weight:400;font-style:normal;text-decoration:none;background-color:inherit;color:#000000;font-family:Arial;font-size:14.0pt;font-variant:normal;text-align:left;direction:ltr;\"\u003eYou can prototype on your laptop and deploy it to the cloud,\u003c/p\u003e\u003cp style\u003d\"font-weight:400;font-style:normal;text-decoration:none;background-color:inherit;color:#000000;font-family:Arial;font-size:14.0pt;font-variant:normal;text-align:left;direction:ltr;\"\u003ewhere it will train faster and youll be able to serve it up using Googles infrastructure.\u003c/p\u003e\u003cp style\u003d\"font-weight:400;font-style:normal;text-decoration:none;background-color:inherit;color:#000000;font-family:Arial;font-size:14.0pt;font-variant:normal;text-align:left;direction:ltr;\"\u003e\u0026#8203;
